import './index.css';

const About = () => (
    <div className='aboutus'>
        <h2 id="heading">About Us</h2>
        <p id = "about-text">
        Umuhinzi platform empowers farmers by making them informed thus able to make better
        decisions.<br/> When purchasing farm inputs through this platform, you will access the latest prices <br/>
        for input products. You will also get news on what is happening in the tea sector.<br/>If 
        you do not  have a smartphone, no worries. We have USSD services for you where you will <br/>
        get the same features.
        By dialing the provided code on your phone, you will access the services we have on the web app.<br/>
        </p>

    </div>
);

export default About;
